import React from 'react';
import "./Formation.scss";
import oclock from '../../images/oclock.png';
import toeic from '../../images/toeic.png';

const Formation = () => {
  return (
    <div className='formation'>

        <p className='formation-subtitle'>
            FORMATIONS
        </p> 

        <div className='formation-content'>
            <div className='formation-bloc'>
                <div className='formation-image'>
                    <img className='formation-oclock' src={oclock}/>
                </div>
            </div>

            <div className='formation-bloc'>
                <div className='formation-image'>
                    <img className='formation-toeic' src={toeic}/>
                </div>
            </div>


        </div>

    </div>
  )
}

export default Formation
